import React from 'react';
import './Settings.css';

const Settings = () => {
  return (
    <div className="settings-page">
      <div className="page-header">
        <h1>Settings</h1>
      </div>
      <div className="settings-content">
        <p>Settings interface coming soon...</p>
      </div>
    </div>
  );
};

export default Settings;
